INSERT INTO `books` (`id`, `name`, `description`, `author`, `image`) VALUES
(2, 'Stop Overthinking', 'Stop Overthinking is a book that understands the exhausting situation you\'ve put yourself in, and how you lose your mind with anxiety and stress. It will walk you through detailed and proven techniques to help rewire your brain, control your thoughts, and change your mental habits.', 'Nick Trenton', );
INSERT INTO `books` (`id`, `name`, `description`, `author`, `image`) VALUES
(3, 'Power Of Positive Thinking', 'The phenomenal and inspiring bestseller by the father of positive thinking. THE POWER OF POSITIVE THINKING is a practical, direct-action application of spiritual techniques to overcome defeat and win confidence, success and joy. Norman Vincent Peale, the father of positive thinking and one of the most widely read inspirational writers of all time, shares his famous formula of faith and optimism which millions of people have taken as their own simple and effective philosophy of living.', 'Norman Vincent Peale', ),
(4, 'Think Straight', 'I know something about you without knowing you. I bet you spend A LOT of time in your head. You know, thinking, worrying, stressing, freaking out -- call it whatever you want. I call it a preoccupied mind. And with what? 99% of your thoughts are useless. William James, once the leading psychologist in America, and one of the founders of the philosophical school of pragmatism, put it best: \"A great many people think they are thinking when they are merely rearranging their prejudices.', 'Darius Foroux', );
INSERT INTO `books` (`id`, `name`, `description`, `author`, `image`) VALUES
(7, 'The Art of Being Alone', 'A guide to embracing solitude, this book explores how to find peace, self-discovery, and empowerment in alone time. It offers practical advice and reflections to help readers transform loneliness into a fulfilling and enriching experience.', 'Sara Maitland', ),
(8, 'Don’t Believe Everything You Think ', 'This book delves into the psychology of thoughts, teaching readers how to challenge negative thinking patterns and cultivate a healthier mindset for greater clarity and emotional well-being.', ' Joseph Nguyen', );
INSERT INTO `books` (`id`, `name`, `description`, `author`, `image`) VALUES
(9, 'Happiness Hack', 'A practical guide to boosting joy in everyday life, this book combines science-backed strategies with simple habits to help readers create lasting happiness, reduce stress, and live a more fulfilling life.', 'Alex Palmer', ),
(10, 'The Mountain Is You ', 'This transformative book explores self-sabotage and personal growth, offering tools to overcome internal obstacles, build resilience, and unlock your full potential to achieve the life you desire.\r\n\r\n', 'Brianna Wiest:', );
INSERT INTO `books` (`id`, `name`, `description`, `author`, `image`) VALUES
(11, 'Life’s Amazing Secrets ', ' A blend of wisdom and practical advice, this book reveals timeless principles for living a balanced, meaningful life. It covers relationships, career, and personal growth, inspiring readers to find purpose and happiness.', 'Gaur Gopal Das', ),
(12, 'Ikigai', 'Discover the Japanese secret to a long and happy life. This book explores the concept of finding your \"reason for being\" and offers insights on how to live with passion, purpose, and fulfillment.', 'Héctor García and Francesc Miralles', );
